  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains a selection of six
  socioeconomic indicators of public health significance and a u201chardship index,u201d
  by Chicago community area, for the years 2008 u2013 2012. The indicators are the
  percent of occupied housing units with more than one person per room (i.e., crowded
  housing); the percent of households living below the federal poverty level; the
  percent of persons in the labor force over the age of 16 years that are unemployed;
  the percent of persons over the age of 25 years without a high school diploma; the
  percent of the population under 18 or over 64 years of age (i.e., dependency); and
  per capita income. Indicators for Chicago as a whole are provided in the final row
  of the table.  See the full dataset description for more information at: https://data.cityofchicago.org/api/views/fwb8-6aw5/files/A5KBlegGR2nWI1jgP6pjJl32CTPwPbkl9KU3FxlZk-A?download=true&filename=P:EPIOEPHIMATERIALSREFERENCESECONOMIC_INDICATORSDataset_Description_socioeconomic_indicators_2012_FOR_PORTAL_ONLY.pdf\",\n\t\"license_title\":
